import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
	faBolt,
	faBuilding,
	faBatteryFull,
	faBatteryEmpty,
	faArrowRight,
	faArrowLeft,
} from "@fortawesome/free-solid-svg-icons";


const GridBatteryBuildingSupply = ({
	internal_capacity,
	battery_capacity,
	battery_capacity_diverted,
	battery_capacity_available,
	building_load,
	
}) => {
	return (
		<div className="p-10 m-20 bg-slate-200 rounded-lg flex-col justify-around w-64">
			<div className="flex flex-col items-center justify-center p-10">
				<div className="flex items-center justify-center shadow-sm rounded-full bg-slate-100 w-32 h-32">
					<FontAwesomeIcon
						icon={faBolt}
						className="text-blue-500 text-3xl"
					/>
				</div>
				<div className="mt-4 text-cente text-smr">
					<p className="text-sm text-gray-600">Grid</p>
				</div>
			</div>
			<div className="flex flex-col items-center justify-center p-10">
				<div className="flex items-center justify-center shadow-sm rounded-full bg-slate-100 w-32 h-32">
					<FontAwesomeIcon
						icon={faBatteryEmpty}
						className="text-blue-500 text-3xl"
					/>
				</div>
				<div className="mt-4 text-cente text-smr">
					<p className="text-sm text-gray-600">Battery</p>
				</div>
			</div>
			<div className="flex flex-col items-center justify-center p-10">
				<div className="flex items-center justify-center shadow-sm rounded-full bg-slate-100 w-32 h-32">
					<FontAwesomeIcon
						icon={faBuilding}
						className="text-blue-500 text-3xl"
					/>
				</div>
				<div className="mt-4 text-cente text-smr">
					<p className="text-sm text-gray-600">Load</p>
				</div>
			</div>
		</div>
	);
};

export default GridBatteryBuildingSupply;
